import React from "react";

class Patient extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: props.name,
      userId: props.userId,
      province: props.province,
    };
  }

  render() {
    return (
      <div className="Patient">
        <h2>
          Name:
          {this.state.name}
        </h2>
        <p>
          user id:
          {this.state.userId}
        </p>
        <p>
          province:
          {this.state.province}
        </p>
      </div>
    );
  }
}

export default Patient;
